import React from 'react';
import './custom-button.styles.scss';
import { CusttomButtonContainer } from './custom-button.styles';

const CustomButton = ({children, ...props}) => (
  <CusttomButtonContainer
   >
    {children}
  </CusttomButtonContainer>
);

export default CustomButton;
